import './App.css';
import githubSVG from "./qr-code.svg";
import AboutMe from './title';
import Main from './main_content';
import Education from './education';
import Skills from './skills';
import Contact from './contact';
import Projects from './projects';


function App() {
  return (
    <div className="App">
      <header>
        <h1>My Resume</h1>
      </header>

      <section className="main-content">
        <AboutMe />

        <Education />

        <Skills />

        <Projects />

        <Contact />
      </section>
    </div>
  );
}

export default App;
